import Card from 'react-bootstrap/Card';

const Text = props => {
    return (
        <Card bg="info" key="1" text="white" style={{ width: '18' }} className="row-cols-1 row-cols-sm-2 row-cols-md-3">
            <Card.Header>{props.title}</Card.Header>
            <Card.Body>
                <Card.Text>{props.text}</Card.Text>
            </Card.Body>
        </Card>)
}

export default Text;
